contracts/1_Storage.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

import "./stringUtils.sol";

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */



contract Storage {

    // string student_id;

    mapping (string => string) students;

    function store(string memory student_name, string memory student_id) public {
        students [student_id] = student_name;
    }


    function retrieve(string memory student_id) public view returns (string memory){
        return students[student_id];
    }
}

contracts/stringUtils.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

library StringUtils {
    function compare(string memory _a, string memory _b) internal pure returns (int) {
        bytes memory a = bytes(_a);
        bytes memory b = bytes(_b);
        uint minLength = a.length;
        if (b.length < minLength) minLength = b.length;
        for (uint i = 0; i < minLength; i++)
            if (a[i] < b[i]) return -1;
            else if (a[i] > b[i]) return 1;

        if (a.length < b.length) return -1;
        else if (a.length > b.length) return 1;
        else return 0;
    }

    function equal(string memory _a, string memory _b) internal pure returns (bool) {
        return compare(_a, _b) == 0;
    }

    function indexOf(string memory _haystack, string memory _needle) internal pure returns (int) {
        bytes memory h = bytes(_haystack);
        bytes memory n = bytes(_needle);
        if (h.length < 1 || n.length < 1 || (n.length > h.length)) return -1;
        else if (h.length > (2**128 - 1)) return -1;

        uint subindex = 0;
        for (uint i = 0; i < h.length; i++) {
            if (h[i] == n[0]) {
                subindex = 1;
                while (subindex < n.length && (i + subindex) < h.length && h[i + subindex] == n[subindex]) {
                    subindex++;
                }
                if (subindex == n.length) return int(i);
            }
        }
        return -1;
    }
}

